      SELECT + col1 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT col2 / - col1 + + col1 * - col0 - col0 / - col0 IN ( col1 ) AND NULL < + col0 - - col0 / + col0;
  - name: tab1

outputs:
  - name: q11134.out
    data: |
